function() {
  // 1. Obtengo el valor crudo de la cookie (cadena Base64 o JWT)
  var raw = {{Cookie – olimpo_v2_access-token}};
  if (!raw) return undefined;

  // 2. Decodifico Base64 estándar → binario UTF-16LE
  function atobSafe(str) {
    try { return atob(str); }
    catch (e) { return null; }
  }
  var binary = atobSafe(raw);
  if (!binary) return undefined;

  // 3. Convierto binario UTF-16LE → cadena JWT
  function utf16leDecode(bin) {
    var s = '';
    for (var i = 0; i < bin.length; i += 2) {
      var lo = bin.charCodeAt(i),
          hi = bin.charCodeAt(i+1) || 0;
      s += String.fromCharCode((hi<<8)|lo);
    }
    return s;
  }
  var jwt = utf16leDecode(binary);

  // 4. Extraigo el payload y lo parseo
  var parts = jwt.split('.');
  if (parts.length !== 3) return undefined;
  // base64url → base64
  var b64 = parts[1].replace(/-/g,'+').replace(/_/g,'/');
  while (b64.length % 4) b64 += '=';
  var json;
  try { json = atob(b64); }
  catch (e) { return undefined; }
  var payload = JSON.parse(json);

  // 5. Devuelvo el userID (ajusta la clave si tu JWT lo llama distinto)
  return payload.userId
      || payload.user_id
      || payload.sub
      || payload.userUniqueId;
}

